function App() {
  return (
    <div className="grid-container">
    <header className="row">
        <div>
            <a  href="/" className="brand">Amazon</a>
        </div>

        <div>
            <a className={classes.nav_items}  href="/cart">Cart</a>
            <a className={classes.nav_items} href="/Signin">Signin</a>
        </div>

    </header>
    <main>
        <ul className="row-products">
          {data.product.map(products=>(

            <li key={products.id} className="product-box">
                  <Products product={products}/>

            </li>

          ))}


        </ul>


    </main>

    <footer className="row center">
       Copyright @ Amazon 2021
    </footer>
</div>
  )
}

export default App;
